À Cittàgazze, Will poursuit ses recherches pour retrouver son père disparu. À ses côtés, Lyra est investie d’une mission dont elle ne connaît pas l’importance et qui la mène droit à la Tour des Anges. Mais dans ce monde parallèle hanté par de terribles spectres, les ennemis sont là où on ne les attend pas. Ensemble, Will et Lyra devront lutter contre les forces obscures et, pour accomplir leur quête, pénétrer dans cette tour énigmatique…

